import { useEffect, useState } from "react"
import CountryWidget from "../components/CountryWidget"

export default function CountryList() {
    const [countryList, setCountryList] = useState(null);

    useEffect(() => {
        fetch(`http://localhost:3000/api/getAvailableCountries`)
            .then(response => {
                if(!response.ok) {
                    throw new Error(response.status)
                }
                return response.json()
            })
            .then(data => {
                setCountryList(data)
            })
            .catch(error => {
                throw new Error(error)
            })
    }, [])

    const list = countryList.map((element, index) => (
        <CountryList key={index} name={element.name} code={element.countryCode}/>
    ))

    return (
        <div>{list}</div>
    )
}
